{% extends 'base.html' %}

{% block header %}

<link href="/static/style/about/about.css" rel="stylesheet" />


<script src="/static/js/mark/about.js" defer></script>

{% endblock header %}

{% block content %}
<main class="about">
    <header class="about-page-header" style="background-image:linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)),
       url(/static/image/about/header.webp)">
        <h2 class="header-title section_title">درباره ما</h2>
    </header>
    <section class="services-container">
        <h3 class="section_title services-title">
            خدمات ما
        </h3>
        <div class="services-wrapper">
            <div class="service-card title">
                <div class="svg-wrapper">
                    <svg class="card-svg animated" id="freepik_stories-walk-in-the-city"
                        xmlns="http://www.w3.org/2000/svg" viewBox="0 0 750 500" version="1.1"
                        xmlns:xlink="http://www.w3.org/1999/xlink" xmlns:svgjs="http://svgjs.com/svgjs">
                        <style>
                            svg#freepik_stories-walk-in-the-city:not(.animated) .animable {
                                opacity: 0;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--background-complete--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--City--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--Streetlights--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--Trees--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--Floor--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-walk-in-the-city.animated #freepik--Character--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
                                animation-delay: 0s;
                            }

                            @keyframes lightSpeedRight {
                                from {
                                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                                    opacity: 0;
                                }

                                60% {
                                    transform: skewX(10deg);
                                    opacity: 1;
                                }

                                80% {
                                    transform: skewX(-2deg);
                                }

                                to {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }

                            @keyframes fadeIn {
                                0% {
                                    opacity: 0;
                                }

                                100% {
                                    opacity: 1;
                                }
                            }

                            @keyframes lightSpeedLeft {
                                from {
                                    transform: translate3d(-50%, 0, 0) skewX(20deg);
                                    opacity: 0;
                                }

                                60% {
                                    transform: skewX(-10deg);
                                    opacity: 1;
                                }

                                80% {
                                    transform: skewX(2deg);
                                }

                                to {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }

                            @keyframes slideUp {
                                0% {
                                    opacity: 0;
                                    transform: translateY(30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: inherit;
                                }
                            }
